import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    const name = 'Larry';

    return (
      <div className="App">
        <h1>The App Component</h1>
        <h2>Hello {name}</h2>
        <h2>Hello {name.toLocaleUpperCase()}</h2>
      </div>
    );
  }
}

export default App;
